import im from '../Images/592e094027cf4140d984aaf7b48c3b4e.jpg';
function ProductDetail() {
    return (
        <div className="container">
            <div className="row">
                <div className="col">
                    <img src={im} alt="" />
                </div>
                <div className="col">

                </div>
            </div>

        </div>
    );
}

export default ProductDetail;
